import React from "react";
import { Box, Grid } from "@material-ui/core";

export default function Profile() {
  return (
    <Box className="body-admin m-0 p-5 bgr-admin" sx={{ minHeight: "100vh" }}>
      <Grid container spacing={1}>
        <Grid item sx={8}>
          <Box className="box">
            <Box className="box badge-purple">asd</Box>
          </Box>
        </Grid>
        <Grid item sx={4}></Grid>
      </Grid>
    </Box>
  );
}
